import React from 'react';

const Netflix = () => {
    return(
        <Card
          key= {sdata[1].id}
          imgsrc={sdata[1].imgsrc}
          sname={sdata[1].sname}
          title={sdata[1].title}
          link={sdata[1].link}
        />
      )
}

export default Netflix;
